import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

// A simple random avatar generator
const getRandomAvatar = () => {
    const avatars = [
        'https://i.pravatar.cc/150?img=1',
        'https://i.pravatar.cc/150?img=2',
        'https://i.pravatar.cc/150?img=3',
        'https://i.pravatar.cc/150?img=4',
    ];
    return avatars[Math.floor(Math.random() * avatars.length)];
};

function PMDashboard() {
    const [projects, setProjects] = useState([]);
    const [message, setMessage] = useState('');
    const [dropdownOpen, setDropdownOpen] = useState(false);
    const [managerName] = useState('John Doe');  // Replace with real user data
    const [avatar] = useState(getRandomAvatar()); // Random avatar
    const navigate = useNavigate();

    // Fetch project data from the backend (adjust API endpoint as necessary)
    useEffect(() => {
        const fetchProjects = async () => {
            try {
                const response = await axios.get('http://localhost:8080/api/projects'); // Example endpoint
                setProjects(response.data);
            } catch (error) {
                setMessage('Failed to fetch projects');
            }
        };

        fetchProjects();
    }, []);

    const handleLogout = () => {
        // Clear local storage and redirect to login page
        localStorage.removeItem('role');
        navigate('/login');
    };

    return (
        <div className="flex">
            {/* Left Sidebar */}
            <div className="w-64 bg-gray-800 text-white h-screen p-6">
                <h2 className="text-2xl font-bold text-white mb-8">Project Manager</h2>
                <ul>
                    <li className="mb-4 hover:bg-gray-700 p-2 rounded cursor-pointer">Dashboard</li>
                    <li className="mb-4 hover:bg-gray-700 p-2 rounded cursor-pointer">Projects</li>
                    <li className="mb-4 hover:bg-gray-700 p-2 rounded cursor-pointer">Settings</li>
                    <li className="mb-4 hover:bg-gray-700 p-2 rounded cursor-pointer">Reports</li>
                </ul>
            </div>

            {/* Main content */}
            <div className="flex-1 p-6">
                {/* Top Bar */}
                <div className="flex items-center justify-between mb-6">
                    <div className="flex items-center">
                        <img src="bytestrone.png" alt="Company Logo" className="h-8 mr-4" />
                        <span className="font-semibold text-lg text-gray-700">Welcome, Project Manager</span>
                    </div>
                    <div className="flex items-center">
                        <span className="mr-4 text-gray-700">{managerName}</span>
                        <img
                            src={avatar}
                            alt="avatar"
                            className="w-10 h-10 rounded-full cursor-pointer"
                            onClick={() => setDropdownOpen(!dropdownOpen)}
                        />
                        {dropdownOpen && (
                            <div className="absolute right-10 top-16 bg-white shadow-md rounded-lg w-40 p-2">
                                <button
                                    onClick={handleLogout}
                                    className="w-full text-left text-gray-700 py-2 px-4 hover:bg-gray-100 rounded-lg"
                                >
                                    Logout
                                </button>
                            </div>
                        )}
                    </div>
                </div>

                {/* Projects Overview */}
                <div>
                    <h3 className="text-xl font-semibold text-gray-700">Active Projects</h3>
                    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mt-4">
                        {projects.filter(project => project.status === 'Active').map((project) => (
                            <div key={project.id} className="bg-white p-4 rounded-lg shadow">
                                <h4 className="font-semibold text-lg text-blue-600">{project.name}</h4>
                                <p className="text-gray-600">Status: {project.status}</p>
                                <p className="text-gray-600">Contributions: {project.totalContributions} ETH</p>
                                <button
                                    onClick={() => navigate(`/projects/${project.id}`)}
                                    className="mt-4 bg-indigo-600 text-white px-4 py-2 rounded hover:bg-indigo-700"
                                >
                                    View Project
                                </button>
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default PMDashboard;
